// src/App.js
import React from 'react';
// import { AuthProvider } from "./context/AuthContext";
import './App.css';
import { Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar/Navbar';
import PetForm from './components/PetRegistration/PetForm';
import GenerateQR from './components/GenerateQR/GenerateQR';
import Home from './components/Home/Home';
import Login from './components/Auth/Login';
import Signup from './components/Auth/Signup';
import Dashboard from './pages/DashBoard';
import ProtectedRoute from './ProtectedRoute';


function App() {
  return (
    <div className="App">
      <AuthProvider> <Navbar /></AuthProvider>

      <Routes>
        <Route path="/" element={<Home/>} />
        <Route path="/register-pet" element={<PetForm />} />
        <Route path="/my-pets" element={<MyPets />} />
       <Route path="/generate-qr" element={<GenerateQR />} />
         <Route path="/login" element={<Login />} />
         <Route path="/signup" element={<Signup />} />
         <Route path="/dashboard" element={
        <ProtectedRoute>
          <Dashboard />
        </ProtectedRoute>
      }/>
      </Routes>
    </div>
  );
}

function MyPets() { return <h1>My Pets</h1>; }

export default App;
